query permits($vesselId: ID!, $permitType: String, $skip: Int, $limit: Int) {
  permits(vesselId: $vesselId, permitType: $permitType, skip: $skip, limit: $limit) {
    items {
      id
      terminated
      terminatedUtcOffset
      permitType
      __typename
    }
    hasNextPage
    __typename
  }
}
